import React from 'react';
import { NavLink, Link } from 'react-router-dom';

import { useSelector } from 'react-redux';

import './styles.css';

export default function Header() {

	const cars = useSelector(state => state);
	return (
		<nav className="nav">
			<NavLink to="/" activeClassName="active" className="">
				Produtos
			</NavLink>
				<ul className="menu">
					<li>
						<NavLink to="/add" activeClassName="active" className="">
							Adicionar
						</NavLink>
					</li>
				</ul>
				<ul >
					<NavLink to="/cartShopping" activeClassName="active" className="">
						<i aria-hidden="true">
							<span className="fa-counter">{cars.add.length}</span>
						</i>
					</NavLink>
				</ul>
		</nav>
	);
}
